    true,nt"url": null,nt"notes": "<p>The State Program Integrity Assessment
    (SPIA) is the Centers for Medicare and Medicaid Services (CMS) first national data
    collection on state Medicaid program integrity activities for the purposes of program
    evaluation and technical assistance support. CMS uses the data from the SPIA to
    develop descriptive reports for each state, identify areas to provide states with
    technical support and assistance, and assess states performance over time. The data
    are collected via an online data collection instrument which includes questions
    on state Medicaid integrity program characteristics, planning, prevention, detection,
    investigation and recovery activities, and technical assistance needs.</p>n",nt"license_title":
